import React, { useState, useEffect, useContext } from "react";
import axios from "axios";
import ReactCrop from 'react-image-crop';
import 'react-image-crop/dist/ReactCrop.css';
import {
    GridContextProvider,
    GridDropZone,
    GridItem,
    swap
} from "react-grid-drag";
import Backdrop from '@material-ui/core/Backdrop';
import CircularProgress from '@material-ui/core/CircularProgress';
import Slider from 'react-rangeslider';
import $ from "jquery";
import Snackbar from '@material-ui/core/Snackbar';
import MuiAlert from '@material-ui/lab/Alert';
import banner from "../../../images/vtc-banner.jpg";
import Switch from "react-switch";
import CancelIcon from '@material-ui/icons/Cancel';
import thumbpics1 from "../../../images/thumbpics1.jpg";
import thumbpics2 from "../../../images/thumbpics2.jpg";
import thumbpics3 from "../../../images/thumbpics3.jpg";
import thumbpics4 from "../../../images/thumbpics4.jpg";
import man from "../../../images/man.png";
import one from "../../../images/1.jpg";
import two from "../../../images/2.jpg";
import three from "../../../images/3.jpg";
import four from "../../../images/4.jpg";
import five from "../../../images/5.jpg";
import six from "../../../images/6.jpg";
import seven from "../../../images/7.jpg";
import eight from "../../../images/8.jpg";
import nine from "../../../images/9.jpg";
import Footer from "../../../components/Footer/AgentFooter";
import AgentHeader from "../Header/AgentHeader";
import Dialog from '@material-ui/core/Dialog';
import DialogTitle from '@material-ui/core/DialogTitle';
import DialogContent from '@material-ui/core/DialogContent';
import { Link, useHistory } from "react-router-dom";
import { AuthContext } from "../../../CommonMethods/Authentication";
import { APIURL, APIPath } from "../../../CommonMethods/Fetch";
import { postRecord } from "../../../CommonMethods/Save";
import { makeStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import SaveIcon from '@material-ui/icons/Save';
import ReactPaginate from 'react-paginate';
const APIGetUserData = APIURL() + "user-details";
const APIGetVideoList = APIURL() + "get-videoList";
const APIChangeService = APIURL() + "change-tour-service";
const APIGetTourDetails = APIURL() + "tour-details";
const APIUpdateVideos = APIURL() + "update-Videos";
const APIPreviewVideo = APIURL() + "preview-video";
const APIPreviewImage = APIURL() + "load-image";
const APIVideoPromotion = APIURL() + "load-video-promotion";
const APIUpdateVideoPromotion = APIURL() + "update-promotions";
const APIGetImageEditor = APIURL() + "load-image-editor";
const APIUpdateImageset = APIURL() + "image-adjustment-editimageset";
const APIUpdateOrder = APIURL() + "change-order";
const APIcropImage = APIURL() + "save-cropper-image-tour";
function Alert(props) {
    return <MuiAlert elevation={6} variant="filled" {...props} />;
}
const useStyles = makeStyles((theme) => ({
    backdrop: {
        zIndex: theme.zIndex.drawer + 9999,
        color: '#fff',
    },
}));
export default function AgentEditVideo(props) {
    let history = useHistory();
    const classes = useStyles();
    const tour_id = props.match.params.tourid;
    const { dispatch } = useContext(AuthContext);
    const context = useContext(AuthContext);
    const [currentUser, setCurrentUser] = useState({});
    const [videoLIst, setVideoList] = useState([]);
    const [sync, setSync] = useState(true);
    const [openError, setOpenError] = useState(false);
    const [openSuccess, setOpenSuccess] = useState(false);
    const [message, setMessage] = useState("");
    const [currentTourData, setCurrentTourData] = useState({});
    const [imageId, setImageId] = useState("");
    const [imageUrl, setImageUrl] = useState("");
    const [element, setElement] = useState("");
    const [maxWidth, setMaxWidth] = React.useState('lg');
    const [openPreviewVideoModal, setOpenPreviewVideoModal] = useState(false);
    const [id, setId] = useState("");
    const [openVideoPromoModal, setOpenVideoPromoModal] = useState(false);
    const [videoPromoData, setVideoPromoData] = useState({});
    const [offset, setOffset] = useState(1);
    const [postPerPage] = useState(6);
    const [pageCount, setPageCount] = useState(0);
    const [allData, setAllData] = useState([]);
    const [totalData, setTotalData] = useState([]);
    const [videourl, setVideoUrl] = useState("");
    const [openPreviewImageModal, setOpenPreviewImageModal] = useState(false);
    const [open, setOpen] = useState(false);
    const [openEditImageModal, setOpenEditImageModal] = useState(false);
    const [blurValue, setBlurValue] = useState(0);
    const [brightValue, setBrightValue] = useState(10);
    const [grayValue, setGrayValue] = useState(0);
    const [contrastValue, setContrastValue] = useState(1);
    const [hueValue, setHueValue] = useState(0);
    const [invertValue, setInvertValue] = useState(0);
    const [opacityValue, setOpacityValue] = useState(100);
    const [saturateValue, setSaturateValue] = useState(10);
    const [sepiaValue, setSepiaValue] = useState(0);
    const [rotatevalue, setRotateValue] = useState(0);
    const [previousblurValue, setpreviousblurValue] = useState(0);
    const [previousbrightValue, setpreviousBrightValue] = useState(10);
    const [previousgrayValue, setpreviousGrayValue] = useState(0);
    const [previouscontrastValue, setpreviousContrastValue] = useState(1);
    const [previoushueValue, setpreviousHueValue] = useState(0);
    const [previousinvertValue, setpreviousInvertValue] = useState(0);
    const [previousopacityValue, setpreviousOpacityValue] = useState(100);
    const [previoussaturateValue, setpreviousSaturateValue] = useState(10);
    const [previoussepiaValue, setpreviousSepiaValue] = useState(0);
    const [previousrotatevalue, setpreviousRotateValue] = useState(0);
    const [editImageData, setEditImageData] = useState({});
    const [crop, setCrop] = useState({
        unit: 'px', // Can be 'px' or '%'
        x: 25,
        y: 25,
        width: 50,
        height: 50
    })
    const [image, setImage] = useState(null);
    const [fileName, setFilename] = useState("");
    const [croppedImage, setCroppedImage] = useState([]);
    useEffect(() => {
        $(".gee_cross").hide();
        $(".gee_menu").hide();
    }, []);
    const ShowMenu = () => {
        $(".gee_menu").slideToggle("slow", function () {
            $(".gee_hamburger").hide();
            $(".gee_cross").show();
        });
    }
    const HideMenu = () => {
        $(".gee_menu").slideToggle("slow", function () {
            $(".gee_cross").hide();
            $(".gee_hamburger").show();
        });
    }
    useEffect(() => {
        if (context.state.user) {
            const obj = { authenticate_key: "abcd123XYZ", agentId: JSON.parse(context.state.user).agentId, tourId: tour_id, imageId: imageId, type: "flyers" };
            postRecord(APIGetImageEditor, obj)
                .then(res => {
                    if (res.data[0].response.status === "success") {
                        setEditImageData(res.data[0].response.data.properties[0]);
                        setBlurValue(res.data[0].response.data.properties[0].blur === null ? 0 : res.data[0].response.data.properties[0].blur);
                        setBrightValue(res.data[0].response.data.properties[0].brightness === 100 ? 10 : res.data[0].response.data.properties[0].brightness);
                        setGrayValue(res.data[0].response.data.properties[0].grayscale === null ? 0 : res.data[0].response.data.properties[0].grayscale);
                        setContrastValue(res.data[0].response.data.properties[0].contrast === 0 ? 1 : res.data[0].response.data.properties[0].contrast);
                        setHueValue(res.data[0].response.data.properties[0].huerotate === null ? 0 : res.data[0].response.data.properties[0].huerotate);
                        setInvertValue(res.data[0].response.data.properties[0].invert === null ? 0 : res.data[0].response.data.properties[0].invert);
                        setOpacityValue(res.data[0].response.data.properties[0].opacity === 0 ? 100 : res.data[0].response.data.properties[0].opacity);
                        setSaturateValue(res.data[0].response.data.properties[0].saturation === 100 ? 10 : res.data[0].response.data.properties[0].saturation);
                        setSepiaValue(res.data[0].response.data.properties[0].sepia === null ? 0 : res.data[0].response.data.properties[0].sepia);
                        setRotateValue(res.data[0].response.data.properties[0].rotate === null ? 0 : res.data[0].response.data.properties[0].rotate);

                        setpreviousblurValue(res.data[0].response.data.properties[0].blur === null ? 0 : res.data[0].response.data.properties[0].blur);
                        setpreviousBrightValue(res.data[0].response.data.properties[0].brightness === 100 ? 10 : res.data[0].response.data.properties[0].brightness);
                        setpreviousGrayValue(res.data[0].response.data.properties[0].grayscale === null ? 0 : res.data[0].response.data.properties[0].grayscale);
                        setpreviousContrastValue(res.data[0].response.data.properties[0].contrast === 0 ? 1 : res.data[0].response.data.properties[0].contrast);
                        setpreviousHueValue(res.data[0].response.data.properties[0].huerotate === null ? 0 : res.data[0].response.data.properties[0].huerotate);
                        setpreviousInvertValue(res.data[0].response.data.properties[0].invert === null ? 0 : res.data[0].response.data.properties[0].invert);
                        setpreviousOpacityValue(res.data[0].response.data.properties[0].opacity === 0 ? 100 : res.data[0].response.data.properties[0].opacity);
                        setpreviousSaturateValue(res.data[0].response.data.properties[0].saturation === 100 ? 10 : res.data[0].response.data.properties[0].saturation);
                        setpreviousSepiaValue(res.data[0].response.data.properties[0].sepia === null ? 0 : res.data[0].response.data.properties[0].sepia);
                        setpreviousRotateValue(res.data[0].response.data.properties[0].rotate === null ? 0 : res.data[0].response.data.properties[0].rotate);
                    }
                });
        }
    }, [context.state.user, tour_id, imageId]);
    const resetImageValues = () => {
        setBlurValue(previousblurValue);
        setBrightValue(previousbrightValue);
        setGrayValue(previousgrayValue);
        setContrastValue(previouscontrastValue);
        setHueValue(previoushueValue);
        setInvertValue(previousinvertValue);
        setOpacityValue(previousopacityValue);
        setSaturateValue(previoussaturateValue);
        setSepiaValue(previoussepiaValue);
        setRotateValue(previousrotatevalue);
    }
    useEffect(() => {
        if (context.state.user) {
            const objusr = { authenticate_key: "abcd123XYZ", agent_id: JSON.parse(context.state.user).agentId };
            postRecord(APIGetUserData, objusr)
                .then(res => {
                    if (res.data[0].response.status === "success") {
                        setCurrentUser(res.data[0].response.data.agent_profile);
                    }
                });
        }
    }, [context.state.user]);
    useEffect(() => {
        if (context.state.user) {
            const obj = { authenticate_key: "abcd123XYZ", agentId: JSON.parse(context.state.user).agentId, tourid: tour_id };
            postRecord(APIGetVideoList, obj)
                .then(res => {
                    if (res.data[0].response.status === "success") {
                        setVideoList(res.data[0].response.dataProvider);
                    }
                });
        }
    }, [context.state.user, sync, tour_id]);
    useEffect(() => {
        if (context.state.user) {
            const obj = { authenticate_key: "abcd123XYZ", agentId: JSON.parse(context.state.user).agentId, tourid: tour_id };
            postRecord(APIGetTourDetails, obj)
                .then(res => {
                    if (res.data[0].response.status === "success") {
                        setCurrentTourData(res.data[0].response.tourdetails);
                    }
                });
        }
    }, [context.state.user, sync, tour_id]);
    useEffect(() => {
        if (videoLIst.length > 0) {
            filterData();
        }
    }, [offset, videoLIst]);
    const handleClose = (event, reason) => {
        if (reason === 'clickaway') {
            return;
        }
        setOpenSuccess(false);
        setOpenError(false);
    };
    const handlePreviewVideo = () => {
        if (imageId === "") {
            setMessage("Please select one Video");
            setOpenError(true);
        }
        else {
            setSync(true);
            setSync(false);
            setOpenPreviewVideoModal(true);
            const obj = { authenticate_key: "abcd123XYZ", agentId: JSON.parse(context.state.user).agentId, tourId: tour_id, videoId: imageId };
            postRecord(APIPreviewVideo, obj)
                .then(res => {
                    if (res.data[0].response.status === "success") {
                        setVideoUrl(res.data[0].response.data.filePath);
                    }
                }).catch(err => {
                    setMessage("Something Went Wrong. Please try again later...");
                    setOpenError(true);
                    setOpen(false);
                });
        }
    }
    const handleBlurChange = (value) => {
        setBlurValue(value);
        setEditImageData({ ...editImageData, "blur": value });
    }
    const handleBrightChange = (value) => {
        setBrightValue(value);
        setEditImageData({ ...editImageData, "brightness": value });
    }
    const handleGrayChange = (value) => {
        setGrayValue(value);
        setEditImageData({ ...editImageData, "grayscale": value });
    }
    const handleContrastChange = (value) => {
        setContrastValue(value);
        setEditImageData({ ...editImageData, "contrast": value });
    }
    const handleHueChange = (value) => {
        setHueValue(value);
        setEditImageData({ ...editImageData, "huerotate": value });
    }
    const handleInvertChange = (value) => {
        setInvertValue(value);
        setEditImageData({ ...editImageData, "invert": value });
    }
    const handleOpacityChange = (value) => {
        setOpacityValue(value);
        setEditImageData({ ...editImageData, "opacity": value });
    }
    const handleSaturateChange = (value) => {
        setSaturateValue(value);
        setEditImageData({ ...editImageData, "saturation": value });
    }
    const handleSepiaChange = (value) => {
        setSepiaValue(value);
        setEditImageData({ ...editImageData, "sepia": value });
    }
    const handleRotate = (data) => {
        setRotateValue(data);
        setEditImageData({ ...editImageData, "rotate": data });
    }

    const updateEditImagedata = () => {
        editImageData.authenticate_key = "abcd123XYZ";
        editImageData.agent_id = JSON.parse(context.state.user).agentId;
        editImageData.tourid = tour_id;
        editImageData.imgid = editImageData.id;
        postRecord(APIUpdateImageset, editImageData)
            .then(res => {
                if (res.data[0].response.status === "success") {
                    setMessage(res.data[0].response.message);
                    setOpenSuccess(true);
                    setSync(false);
                }
                else {
                    setMessage(res.data[0].response.message);
                    setOpenError(true);
                    setSync(false);
                }
                setSync(true);
            }).catch(err => {
                setMessage("Something Went Wrong. Please try again later...");
                setOpenError(true);
                setOpen(false);
            });
        const obj = {
            authenticate_key: "abcd123XYZ",
            tourId: tour_id,
            imageId: editImageData.id,
            imageName: croppedImage,
            iscrop: 1,
        }

        const formData = new FormData();
        for (let i in obj) {
            if (i === 'imageName') {
                for (let file of obj[i]) {
                    formData.append('imageName', file);
                }
            }
            else {
                formData.append(i, obj[i])
            }
        }
        axios
            .post(APIcropImage, formData, {})
            .then(res => {
                if (res.data[0].response.status === "success") {
                    setOpen(false);
                }
                else {
                    setOpen(false);
                }
                setSync(false);
            })
            .catch(err => console.log(err));
    }
    const handlePreviewImage = () => {
        if (imageId === "") {
            setMessage("Please select one image");
            setOpenError(true);
        }
        else {
            setSync(true);
            setSync(false);
            setOpenPreviewImageModal(true);
            const obj = { authenticate_key: "abcd123XYZ", agentId: JSON.parse(context.state.user).agentId, tourId: tour_id, imageId: imageId };
            postRecord(APIPreviewImage, obj)
                .then(res => {
                    if (res.data[0].response.status === "success") {
                        setImageUrl(res.data[0].response.data.filepath);
                    }
                }).catch(err => {
                    setMessage("Something Went Wrong. Please try again later...");
                    setOpenError(true);
                    setOpen(false);
                });
        }
    }
    const handleImageId = (data) => {
        var div = document.getElementById("myDiv" + data.id);
        if (element !== "") {
            element.classList.remove("active");
        }
        if (element === div) {
            div.classList.remove("active");
            setElement("");
            setImageId("");
        }
        else {
            div.classList.add("active");
            setElement(div);
            setImageId(data.id);
        }
    }
    const handleTourChange = (event) => {
        var check = event.target.checked === true ? 1 : 0;
        const obj = { authenticate_key: "abcd123XYZ", agent_id: JSON.parse(context.state.user).agentId, tourid: tour_id, status: "tour", virtualtourservice: check };
        postRecord(APIChangeService, obj)
            .then(res => {
                if (res.data[0].response.status === "success") {
                    setMessage(res.data[0].response.message);
                    setOpenSuccess(true);
                    setSync(false);
                }
                else {
                    setMessage(res.data[0].response.message);
                    setOpenError(true);
                    setSync(false);
                }
                setSync(true);
            }).catch(err => {
                setMessage("Something Went Wrong. Please try again later...");
                setOpenError(true);
                setOpen(false);
            });
    }
    const handleFlyerChange = (event) => {
        var check = event.target.checked === true ? 1 : 0;
        const obj = { authenticate_key: "abcd123XYZ", agent_id: JSON.parse(context.state.user).agentId, tourid: tour_id, status: "flyer", flyerservice: check };
        postRecord(APIChangeService, obj)
            .then(res => {
                if (res.data[0].response.status === "success") {
                    setMessage(res.data[0].response.message);
                    setOpenSuccess(true);
                    setSync(false);
                }
                else {
                    setMessage(res.data[0].response.message);
                    setOpenError(true);
                    setSync(false);
                }
                setSync(true);
            }).catch(err => {
                setMessage("Something Went Wrong. Please try again later...");
                setOpenError(true);
                setOpen(false);
            });
    }
    const handleVideoChange = (event) => {
        var check = event.target.checked === true ? 1 : 0;
        const obj = { authenticate_key: "abcd123XYZ", agent_id: JSON.parse(context.state.user).agentId, tourid: tour_id, status: "video", videoservice: check };
        postRecord(APIChangeService, obj)
            .then(res => {
                if (res.data[0].response.status === "success") {
                    setMessage(res.data[0].response.message);
                    setOpenSuccess(true);
                    setSync(false);
                }
                else {
                    setMessage(res.data[0].response.message);
                    setOpenError(true);
                    setSync(false);
                }
                setSync(true);
            }).catch(err => {
                setMessage("Something Went Wrong. Please try again later...");
                setOpenError(true);
                setOpen(false);
            });
    }
    const handleVideoTourChange = (event, id) => {
        var data = [];
        videoLIst.forEach(res => {
            if (res.id === id) {
                if (event === true) {
                    res.enableonvideo = 1;
                }
                else {
                    res.enableonvideo = 0;
                }
            }
            data.push(res);
        });
        setVideoList(data);
    }
    const handleHorRadioChange = (event, id) => {
        var data = [];
        videoLIst.forEach(res => {
            if (res.id === id) {
                res.camera_horizontal = event.target.value;
            }
            data.push(res);
        });
        setVideoList(data);
    }
    const handleVerRadioChange = (event, id) => {
        var data = [];
        videoLIst.forEach(res => {
            if (res.id === id) {
                res.camera_vertical = event.target.value;
            }
            data.push(res);
        });
        setVideoList(data);
    }
    const handleZoomRadioChange = (event, id) => {
        var data = [];
        videoLIst.forEach(res => {
